                    jsxData: () => Object(r.jsxs)(r.Fragment, {
                        children: [Object(r.jsx)("p", {
                            children: "\u0412\u0430\u0437\u043e\u0440\u0430\u0442\u0438 \u043c\u0430\u043e\u0440\u0438\u0444 \u0432\u0430 \u0438\u043b\u043c\u0438 \u04b6\u0443\u043c\u04b3\u0443\u0440\u0438\u0438 \u0422\u043e\u04b7\u0438\u043a\u0438\u0441\u0442\u043e\u043d \u0431\u0430 \u0442\u0430\u0432\u0430\u04b7\u04b7\u0443\u04b3\u0438 \u0442\u0430\u0440\u0431\u0438\u044f\u0442\u0433\u0438\u0440\u0430\u043d\u0434\u0430\u0433\u043e\u043d\u0438 \u043c\u0443\u0430\u0441\u0441\u0438\u0441\u0430\u04b3\u043e\u0438 \u0442\u043e\u043c\u0430\u043a\u0442\u0430\u0431\u04e3, \u0445\u043e\u043d\u0430\u043d\u0434\u0430\u0433\u043e\u043d\u0438 \u043c\u0443\u0430\u0441\u0441\u0438\u0441\u0430\u04b3\u043e\u0438 \u0442\u0430\u04b3\u0441\u0438\u043b\u043e\u0442\u0438 \u0443\u043c\u0443\u043c\u04e3, \u043e\u043c\u04ef\u0437\u0433\u043e\u0440\u043e\u043d \u0432\u0430 \u043f\u0430\u0434\u0430\u0440\u0443 \u043c\u043e\u0434\u0430\u0440\u043e\u043d \u043c\u0435\u0440\u0430\u0441\u043e\u043d\u0430\u0434, \u043a\u0438 \u0431\u043e \u0434\u0430\u0440\u043d\u0430\u0437\u0430\u0440\u0434\u043e\u0448\u0442\u0438 \u0441\u0430\u0440\u0434 \u043e\u043c\u0430\u0434\u0430\u043d\u0438 \u04b3\u0430\u0432\u043e \u0432\u0430 \u0431\u043e \u043c\u0430\u049b\u0441\u0430\u0434\u0438 \u04b3\u0438\u0444\u0437\u0438 \u0441\u0430\u043b\u043e\u043c\u0430\u0442\u0438\u0438 \u0442\u0430\u0440\u0431\u0438\u044f\u0442\u0433\u0438\u0440\u0430\u043d\u0434\u0430\u0433\u043e\u043d\u0443 \u0445\u043e\u043d\u0430\u043d\u0434\u0430\u0433\u043e\u043d \u0434\u0430\u0440 \u0430\u0441\u043e\u0441\u0438 \u0444\u0430\u0440\u043c\u043e\u0438\u0448\u0438 \u0432\u0430\u0437\u0438\u0440\u0438 \u043c\u0430\u043e\u0440\u0438\u0444 \u0432\u0430 \u0438\u043b\u043c\u0438 \u04b6\u0443\u043c\u04b3\u0443\u0440\u0438\u0438 \u0422\u043e\u04b7\u0438\u043a\u0438\u0441\u0442\u043e\u043d \u0430\u0437 10.01.2023, \u211635 \xab\u0414\u0430\u0440 \u0431\u043e\u0440\u0430\u0438 \u0442\u0430\u043c\u0434\u0438\u0434 \u043d\u0430\u043c\u0443\u0434\u0430\u043d\u0438 \u0442\u0430\u044a\u0442\u0438\u043b\u0438 \u0437\u0438\u043c\u0438\u0441\u0442\u043e\u043d\u0430\u0438 \u0445\u043e\u043d\u0430\u043d\u0434\u0430\u0433\u043e\u043d \u0434\u0430\u0440 \u043c\u0443\u0430\u0441\u0441\u0438\u0441\u0430\u04b3\u043e\u0438 \u0442\u043e\u043c\u0430\u043a\u0442\u0430\u0431\u04e3 \u0432\u0430 \u0442\u0430\u04b3\u0441\u0438\u043b\u043e\u0442\u0438 \u0443\u043c\u0443\u043c\u04e3\xbb \u0434\u0430\u0440 \u043c\u0443\u0430\u0441\u0441\u0438\u0441\u0430\u04b3\u043e\u0438 \u0442\u043e\u043c\u0430\u043a\u0442\u0430\u0431\u04e3 \u0432\u0430 \u0442\u0430\u04b3\u0441\u0438\u043b\u043e\u0442\u0438 \u0443\u043c\u0443\u043c\u0438\u0438 \u04b6\u0443\u043c\u04b3\u0443\u0440\u0438\u0438 \u0422\u043e\u04b7\u0438\u043a\u0438\u0441\u0442\u043e\u043d \u043d\u043e\u0432\u043e\u0431\u0430\u0441\u0442\u0430 \u0430\u0437 \u0448\u0430\u043a\u043b\u0438 \u0442\u0430\u0448\u043a\u0438\u043b\u0438\u044e \u04b3\u0443\u049b\u0443\u049b\u04e3 \u0442\u0430\u044a\u0442\u0438\u043b\u0438 \u0437\u0438\u043c\u0438\u0441\u0442\u043e\u043d\u0430\u0438 \u0445\u043e\u043d\u0430\u043d\u0434\u0430\u0433\u043e\u043d \u0442\u043e 16 \u044f\u043d\u0432\u0430\u0440\u0438 \u0441\u043e\u043b\u0438 2023 \u0442\u0430\u043c\u0434\u0438\u0434 \u043a\u0430\u0440\u0434\u0430 \u0448\u0443\u0434."
                        }), Object(r.jsx)("p", {
                            children: "\u041c\u0430\u0448\u0493\u0443\u043b\u0438\u044f\u0442\u04b3\u043e \u0434\u0430\u0440 \u043c\u0443\u0430\u0441\u0441\u0438\u0441\u0430\u04b3\u043e\u0438 \u0442\u043e\u043c\u0430\u043a\u0442\u0430\u0431\u04e3 \u0432\u0430 \u0442\u0430\u04b3\u0441\u0438\u043b\u043e\u0442\u0438 \u0443\u043c\u0443\u043c\u04e3 \u0430\u0437 16-\u0443\u043c\u0438 \u044f\u043d\u0432\u0430\u0440 \u043e\u0493\u043e\u0437 \u0433\u0430\u0440\u0434\u0438\u0434\u0430, \u0441\u043e\u0430\u0442\u04b3\u043e\u0438 \u0434\u0430\u0440\u0441\u0438\u0438 \u0434\u0430\u0440 \u0434\u0430\u0432\u043e\u043c\u0438 \u0442\u0430\u044a\u0442\u0438\u043b \u0438\u04b7\u0440\u043e\u043d\u0430\u0448\u0443\u0434\u0430 \u0442\u0438\u0431\u049b\u0438 \u04b7\u0430\u0434\u0432\u0430\u043b\u0438 \u0430\u043b\u043e\u04b3\u0438\u0434\u0430\u0438 \u0442\u0430\u0441\u0434\u0438\u049b\u0433\u0430\u0440\u0434\u0438\u0434\u0430\u0438 \u0434\u0430\u0440\u0441\u0438 \u0438\u043b\u043e\u0432\u0430\u0433\u04e3 \u0434\u0430\u0440 \u043d\u0438\u043c\u0441\u043e\u043b\u0430\u0438 \u0434\u0443\u044e\u043c\u0438 \u0441\u043e\u043b\u0438 \u0442\u0430\u04b3\u0441\u0438\u043b\u0438 2022-2023 \u0430\u0437 \u04b3\u0438\u0441\u043e\u0431\u0438 \u0442\u0430\u044a\u0442\u0438\u043b\u0438 \u0431\u0430\u04b3\u043e\u0440\u04e3 \u0432\u0430 \u0442\u043e\u0431\u0438\u0441\u0442\u043e\u043d\u0430 \u04b7\u0443\u0431\u0440\u043e\u043d \u043a\u0430\u0440\u0434\u0430 \u043c\u0435\u0448\u0430\u0432\u0430\u0434."
                        }), Object(r.jsx)("p", {
                            children: "\u04b2\u0430\u043c\u0437\u0430\u043c\u043e\u043d, \u0434\u0430\u0440 \u0430\u0441\u043e\u0441\u0438 \u0444\u0430\u0440\u043c\u043e\u0438\u0448\u0438 \u043c\u0430\u0437\u043a\u0443\u0440 \u0441\u0430\u0440\u0434\u043e\u0440\u043e\u043d\u0438 \u0421\u0430\u0440\u0440\u0430\u0451\u0441\u0430\u0442\u0438 \u043c\u0430\u043e\u0440\u0438\u0444\u0438 \u0448\u0430\u04b3\u0440\u0438 \u0414\u0443\u0448\u0430\u043d\u0431\u0435, \u0440\u0430\u0451\u0441\u0430\u0442\u04b3\u043e\u0438 \u043c\u0430\u043e\u0440\u0438\u0444\u0438 \u0412\u0438\u043b\u043e\u044f\u0442\u0438 \u041c\u0443\u0445\u0442\u043e\u0440\u0438 \u041a\u04ef\u04b3\u0438\u0441\u0442\u043e\u043d\u0438 \u0411\u0430\u0434\u0430\u0445\u0448\u043e\u043d, \u0432\u0438\u043b\u043e\u044f\u0442\u04b3\u043e\u0438 \u0421\u0443\u0493\u0434\u0443 \u0425\u0430\u0442\u043b\u043e\u043d, \u0441\u0430\u0440\u0434\u043e\u0440\u043e\u043d\u0438 \u0440\u0430\u0451\u0441\u0430\u0442\u0443 \u043c\u0443\u0434\u0438\u0440\u043e\u043d\u0438 \u0448\u0443\u044a\u0431\u0430\u04b3\u043e\u0438 \u043c\u0430\u043e\u0440\u0438\u0444\u0438 \u0448\u0430\u04b3\u0440\u0443 \u043d\u043e\u04b3\u0438\u044f\u04b3\u043e\u0438 \u0442\u043e\u0431\u0435\u0438 \u04b7\u0443\u043c\u04b3\u0443\u0440\u04e3, \u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u043e\u043d\u0438 \u043c\u0443\u0430\u0441\u0441\u0438\u0441\u0430\u04b3\u043e\u0438 \u0442\u0430\u044a\u043b\u0438\u043c\u0438\u0438 \u043c\u0430\u049b\u043e\u043c\u0438 \u04b7\u0443\u043c\u04b3\u0443\u0440\u0438\u044f\u0432\u0438\u0434\u043e\u0448\u0442\u0430 \u0432\u0430 \u0445\u0443\u0441\u0443\u0441\u04e3 \u0443\u04b3\u0434\u0430\u0434\u043e\u0440 \u0433\u0430\u0440\u0434\u0438\u0434\u0430\u0430\u043d\u0434, \u043a\u0438 \u04b7\u0438\u04b3\u0430\u0442\u0438 \u0431\u0430 \u0442\u0430\u044a\u0442\u0438\u043b \u0431\u0430\u0440\u043e\u043c\u0430\u0434\u0430\u043d\u0438 \u0445\u043e\u043d\u0430\u043d\u0434\u0430\u0433\u043e\u043d \u0442\u0430\u0434\u0431\u0438\u0440\u04b3\u043e\u0438 \u0437\u0430\u0440\u0443\u0440\u04e3 \u0430\u043d\u0434\u0435\u0448\u0430\u043d\u0434."
                        })]
                    })
