                            children: "\u04b2\u0430\u043c\u0437\u0430\u043c\u043e\u043d, \u0430\u0437 \u04b7\u043e\u043d\u0438\u0431\u0438 \u043c\u0443\u0442\u0430\u0445\u0430\u0441\u0441\u0438\u0441\u043e\u043d\u0438 \u041a\u043e\u0440\u0445\u043e\u043d\u0430\u0438 \u0432\u043e\u04b3\u0438\u0434\u0438 \u0434\u0430\u0432\u043b\u0430\u0442\u0438\u0438 \u201c\u0428\u0430\u04b3\u0440\u0438 \u04b3\u0443\u0448\u043c\u0430\u043d\u0434 (Smart City)\u201d-\u0438 \u041c\u0430\u049b\u043e\u043c\u043e\u0442\u0438 \u0438\u04b7\u0440\u043e\u0438\u044f\u0438 \u04b3\u043e\u043a\u0438\u043c\u0438\u044f\u0442\u0438 \u0434\u0430\u0432\u043b\u0430\u0442\u0438\u0438 \u0448\u0430\u04b3\u0440\u0438 \u0414\u0443\u0448\u0430\u043d\u0431\u0435 \u0438\u043c\u043a\u043e\u043d\u0438\u044f\u0442\u04b3\u043e\u0438 \u0443\u0442\u043e\u049b\u0438 \u0448\u0430\u0445\u0441\u0438\u0438 \u0431\u0430\u0440\u043d\u043e\u043c\u0430\u0438 \u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043d\u0438\u0438 \u201ceDonish\u201d \u043d\u0430\u043c\u043e\u0438\u0448 \u0434\u043e\u0434\u0430 \u0448\u0443\u0434. \u0414\u0430\u0440 \u0430\u043d\u04b7\u043e\u043c \u0431\u0430 \u043c\u0430\u0441\u044a\u0443\u043b\u0438\u043d \u043b\u043e\u0433\u0438\u043d \u0432\u0430 \u0440\u0430\u043c\u0437 \u0441\u0443\u043f\u043e\u0440\u0438\u0434\u0430 \u0448\u0443\u0434"
